* {
  padding: 0;
  margin: 0;
  font-family: "Roboto", sans-serif;
}

.list {
  display: flex;
  flex-direction: column;
  gap: 15px;
}
.list span {
  display: flex;
}

.main {
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
}

button {
  width: 90%;
  height: 40px;
  border-radius: 5px;
  border-style: none;
  color: hsl(0, 0%, 100%);
  font-size: small;
}

